import "./Home.css";
import "@fontsource/poppins";
import mockup from '../../assets/mockup.png'
import photo from '../../assets/photo.jpg'
import verify from '../../assets/verify.png'
import flowchart from '../../assets/flowchart.png'

function Home() {

  return (
    <div className="homePage">

      {/* Start Header */} 
      <div id="containerheader">
        <h2 id="titleh2">Artificial Inteligence For <br></br>MiniScript</h2>
        <p id="subtitlep">MiniMaxis your helper for your bitcoin development!</p>
        <img src={mockup} id="mockup"/>
      </div>
      {/* End Header */} 
      
      {/* Start Winner */} 
      <div className="containerwinner">
        <img src={photo} id="photo"/>

        <div id="textswinner">
          <p id="textw1">Winner the SatsConf</p>

          <div className="row">
            <img src={verify} id="verify"/>
            <p className="prow">We won at the biggest bitcoin event in Brazil.</p>
          </div>

          <div className="row">
            <img src={verify} id="verify"/>
            <p className="prow">We developed an artificial intelligence model in just two days.</p>
          </div>

          <div className="row">
            <img src={verify} id="verify"/>
            <p className="prow">We solve the pain of miniscript developers.</p>
          </div>
        </div>
      </div>
      {/* End Winner */} 

      
      {/*<div className="containerflow">*/} 
        {/*<p id="textw1">Flow Chart Application</p>*/} 
        {/*<img src={flowchart} id="imgflow"/>*/} 
      {/*</div> */} 

      <div id="containerfooter">
        <p id="pfooter">2023 Â© MINIMAXIS - ALL RIGHTS RESERVED </p>
      </div>
    </div>
  );
}

export default Home;
